import React from "react";
import { Line } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
} from 'chart.js';

ChartJS.register(
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
);

export const options = {
    responsive: true,
    plugins: {
        legend: {
            position: 'top'
        },
        title: {
            display: true,
            text: 'Chart.js Line Chart',
        },
    },
};

export default class UptimeChart extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            uptimeChart: {"data":{"labels":["10 am","11 am","12 pm","1 pm","2 pm","3 pm","4 pm","5 pm","6 pm","7 pm","8 pm","9 pm"],"datasets":[{"label":"Uptime","data":[100,100,100,100,100,100,100,100,100,100,100,100],"borderColor":"green","backgroundColor":"green"}]},"options":{
                    responsive: true,
                    plugins: {
                        legend: {
                            position: 'top',
                        },
                        title: {
                            display: true,
                            text: 'Chart.js Line Chart',
                        },
                    },
                }}
        }

    }

    render() {
        return (
            <div>
                <h5>
                    <span>Uptime</span>
                    <a
                        className="link"
                        style={{ float: "right" }}
                        data-bind="text: $root.deviceSelectedChartPeriod, click: $root.toggle_NetworkingDeviceSelectedChartPeriod"
                    >
                        Hourly
                    </a>
                </h5>

                <Line
                    options={options}
                    data={this.state.uptimeChart.data}
                    width={'656px'}
                    height={'328px'}
                    style={{ display: 'block', boxSizing: 'border-box', height: '164px', width: '328px' }}
                />
            </div>
        );
    }
}
